import React from 'react'
import './PokemonList.css'
import '../../App.css';
import logo from '../../logo.svg'
import Card from '@material-ui/core/Card';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import InfoIcon from '@material-ui/icons/Info';
import pokemonListData from './PokemonListData.js';
import Pagination from '@material-ui/lab/Pagination';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Skeleton from '@material-ui/lab/Skeleton';

/**
* @author
* @function PokemonList
**/

const PokemonList = (props) => {
  return(
    <Card className='card'>
        <div className='header'>
            List Pokemon
        </div>
        <div className='search'>
          Ini buat search
        </div>
        <div className='list'>
          <Card className='card-value'>
          <GridList cols={4} cellHeight={180} className='gridList'>
            <GridListTile cols={4} style={{ height: 'auto' }}>
              </GridListTile>
              {pokemonListData.map((tile) => (
              //   <GridListTile key={tile.img}>
              //     <img src={logo} alt={tile.title} />
              //     <GridListTileBar
              //       title={tile.title} 
              //       subtitle={<span>by: dadadadad</span>}
              //       actionIcon={
              //         <IconButton aria-label={`info about adasdasdasda`} className='icon'>
              //           <InfoIcon />
              //         </IconButton>
              //       }
              //     />
              // </GridListTile>
              <Skeleton id={title.title} variant="rect" width={'auto'} height={'auto'} />
            ))}
          </GridList>
          <div className='pagination'>
            <Pagination count={11} defaultPage={6} boundaryCount={2} />
          </div>
          </Card>
        </div>
    </Card>
   )

 }

export default PokemonList;
